import { Main,Breadcrumbs,H3,Label,Button,GridRow,GridCol,TextArea } from "govuk-react";
import Navigation from "../../Components/Navigation";
import { useLocation } from "react-router-dom";
import { useState } from "react";

function DoctorViewandUpdate(){

    const location = useLocation();
    const NHSNumber = location.state.PatientNHSNumber;
    const FName = location.state.PatientFName;
    const SName = location.state.PatientSName;
    const DOB = location.state.PatientDOB;
    const MedicalRecord = location.state.PatientMedicalNote;

    const [newMedicalRecord, setNewMedicalRecord] = useState("");

    const handleSaveClick = () => {
        // Combine the new medical record with the old one
        const updatedMedicalRecord = `${MedicalRecord} \n ${newMedicalRecord}`;
        console.log("Updated medical record:", updatedMedicalRecord);
        // You can do whatever you need to do with the updated medical record here, such as sending it to a server
    }

    return(
        <div>
            <Navigation pageLink1="/" PageName1="Home" pageLink2="/DoctorDashBoard" PageName2="Doctor DashBoard" pageLink3="/DoctorAppointment" PageName3="Doctor List Of Appointments"/>

            <Main>
                <Breadcrumbs>
                    <Breadcrumbs.Link to="/">HomePage</Breadcrumbs.Link>
                    <Breadcrumbs.Link href="/DoctorDashBoard">Doctor DashBoard</Breadcrumbs.Link>
                    <Breadcrumbs.Link href="/DoctorViewandUpdate">Doctor View and Update Medical Records</Breadcrumbs.Link>
                </Breadcrumbs>

                <br/><br/>
                <H3 size="LARGE" style={{textAlign: "center"}}>
                    View and Update Medical Records
                </H3>
                <br/><br/><br/>

                <GridRow>
                    <GridCol>
                        <div>
                            <Label>
                                <p>NHS Number: {NHSNumber}</p>
                            </Label>
                        </div>
                    </GridCol>
                </GridRow>

                <GridRow>
                    <GridCol>
                        <div>
                            <p>Patient Name: {FName} {SName}</p>
                        </div>
                    </GridCol>
                    <GridCol>
                        <div>
                            <p>Date Of Birth: {DOB}</p>
                        </div>
                    </GridCol>
                </GridRow>

                <br/><br/><br/>
                <Button start onClick={() => setNewMedicalRecord("")}>
                    Update
                </Button>
                <GridRow>
                    <GridCol>
                        <div>
                            <Label>
                                <TextArea
                                    input={{
                                        name: 'group1'
                                    }}
                                    value={newMedicalRecord}
                                    onChange={(event) => setNewMedicalRecord(event.target.value)}
                                />
                                <div style={{marginTop: "1rem"}}>
                                    Previous Medical Record:
                                    <br />
                                    {MedicalRecord}
                                </div>
                            </Label>
                        </div>
                    </GridCol>
                </GridRow>  
                {newMedicalRecord &&
                    <Button onClick={handleSaveClick}>
                        Save
                    </Button>
                }
            </Main>  

            <br/><br/><br/>  
        </div>
        
    );
}
export default DoctorViewandUpdate;
